import logging
from enum import Enum, auto
from datetime import datetime, timedelta
import uuid
from typing import List, Dict, Optional

# Logging Configuration
logging.basicConfig(
    level=logging.INFO,
    format='%(asctime)s - %(name)s - %(levelname)s - %(message)s',
    filename='system_activities.log'
)
logger = logging.getLogger(__name__)

# Enums for different states and types
class SubmissionStatus(Enum):
    DRAFT = auto()
    SUBMITTED = auto()
    VALIDATING = auto()
    VALIDATED = auto()
    PUBLISHED = auto()
    REJECTED = auto()

class SubmissionType(Enum):
    FABS = auto()
    DABS = auto()
    FPDS = auto()

class GTASStatus(Enum):
    OPEN = auto()
    CLOSED = auto()

# Classes for the system
class Submission:
    def __init__(self, submission_id: str, submitter_id: str, submission_type: SubmissionType):
        self.submission_id = submission_id
        self.submitter_id = submitter_id
        self.submission_type = submission_type
        self.status = SubmissionStatus.DRAFT
        self.created_at = datetime.now()
        self.updated_at = datetime.now()

    def update_status(self, new_status: SubmissionStatus):
        self.status = new_status
        self.updated_at = datetime.now()
        logger.info(f"Submission {self.submission_id} status updated to {new_status.name}")

    def get_status(self) -> SubmissionStatus:
        return self.status

class FABSValidator:
    @staticmethod
    def validate(submission: Submission) -> bool:
        if submission.submission_type != SubmissionType.FABS:
            logger.error("Invalid submission type for FABS validation")
            return False
        # Mock validation logic
        logger.info(f"Validating FABS submission {submission.submission_id}")
        return True

class DABSValidator:
    @staticmethod
    def validate(submission: Submission) -> bool:
        if submission.submission_type != SubmissionType.DABS:
            logger.error("Invalid submission type for DABS validation")
            return False
        # Mock validation logic
        logger.info(f"Validating DABS submission {submission.submission_id}")
        return True

class DataManager:
    @staticmethod
    def update_submission_status(submission: Submission, new_status: SubmissionStatus):
        if submission.status == SubmissionStatus.PUBLISHED and new_status == SubmissionStatus.PUBLISHED:
            logger.error("Cannot publish an already published submission")
            return
        submission.update_status(new_status)

class GTASManager:
    def __init__(self):
        self.status = GTASStatus.OPEN
        self.window_start = None
        self.window_end = None

    def set_window(self, start: datetime, end: datetime):
        self.window_start = start
        self.window_end = end
        self.status = GTASStatus.CLOSED
        logger.info(f"GTAS window set from {start} to {end}")

    def clear_window(self):
        self.window_start = None
        self.window_end = None
        self.status = GTASStatus.OPEN
        logger.info("GTAS window cleared")

class DFileGenerator:
    @staticmethod
    def generate(submission: Submission) -> str:
        if submission.status != SubmissionStatus.VALIDATED:
            logger.error("Submission must be validated before generating D file")
            return ""
        # Mock D file generation
        d_file_name = f"D_file_{submission.submission_id}.csv"
        logger.info(f"Generated D file {d_file_name} for submission {submission.submission_id}")
        return d_file_name

class Publisher:
    @staticmethod
    def publish(submission: Submission) -> bool:
        if submission.status != SubmissionStatus.VALIDATED:
            logger.error("Submission must be validated before publishing")
            return False
        if submission.status == SubmissionStatus.PUBLISHED:
            logger.error("Submission already published")
            return False
        submission.update_status(SubmissionStatus.PUBLISHED)
        logger.info(f"Published submission {submission.submission_id}")
        return True

